import logo from './logo.svg';
import  Accueil from './composant/accueil/Accueil';
import './App.css';


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">

          <p >
            Accueil
          </p>
        <Accueil children="blhthg"/>
        </header>
      </div>
    );
  }
}

export default App;
